@media only screen and (max-width: 600px) {
  section {
    width: 100%;

    .header-banner {
      margin: 5px 0;
      background-color: blue;

      .hb-img {
        margin: 0 5px;
        width: 100%;

        .text {
          p {
            font-weight: bold;
          }
        }
      }
    }
  }
}

@media only screen and (max-width: 780px) {
