@media only screen and (max-width: 950px) {
  .showrooms {
    margin: 10px 0;
    width: 100%;

    .sr-cards {
      .sr-card {
        .left {
          margin-right: 10px;
        }

        .right {
          margin-left: 10px;
        }

        .color {
          width: 50%;
        }

        .sr-info {
          width: 50%;
          height: 100%;

          p {
            width: 100%;
            max-height: 100%;
          }
        }
      }
